        setCancelReason(json.cancel_reason);
        // DUMMY VISITS 
        setVisits(json.visits)
        setQuotations(json.quotations)

        // Survey
        setSurvey(json.current_survey)

      }).finally(function() {
        setLoading(false)
      });
  }


